  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Moosehorn NWR
  outlines Refuge accomplishments from May through August of 1946. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing and haying.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses and Refuge
  visitors. N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
